import React from 'react';
import '../Button/Button.css';

function Button({ title, onClick, type, color, marginTop }) {
    return (
        <button
            onClick={onClick}
            style={{
                backgroundColor: color,
                margin: marginTop,
            }}
            className='buttonStyle'
            type={type}
        >
            {title}
        </button>
    );
}

export default Button;
